4. \\u064a\\u062e\\u062a\\u0644\\u0641 \\u0639\\u0646 \\u0645\\u0646\\u0634\\u0648\\u0631 \\u0627\\u0644\\u0645\\u062f\\u0648\\u0646\\u0629 \\u0644\\u0623\\u0646\\u0647 \\u0633\\u064a\\u0628\\u0642\\u0649 \\u0641\\u064a \\u0645\\u0643\\u0627\\u0646 \\u0648\\u0627\\u062d\\u062f \\u0648\\u0633\\u064a\\u0638\\u0647\\u0631 \\u0641\\u064a \\u0627\\u0644\\u062a\\u0646\\u0642\\u0644 \\u0641\\u064a \\u0645\\u0648\\u0642\\u0639\\u0643 (\\u0641\\u064a \\u0645\\u0639\\u0638\\u0645 \\u0627\\u0644\\u0633\\u0645\\u0627\\u062a). \\u064a\\u0628\\u062f\\u0623 \\u0645\\u0639\\u0638\\u0645 \\u0627\\u0644\\u0623\\u0634\\u062e\\u0627\\u0635 \\u0628\\u0635\\u0641\\u062d\\u0629 \\\"\\u062d\\u0648\\u0644\\\" \\u0627\\u0644\\u062a\\u064a \\u062a\\u0642\\u062f\\u0645\\u0647\\u0645 \\u0625\\u0644\\u0649 \\u0632\\u0648\\u0627\\u0631 \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639 \\u0627\\u0644\\u0645\\u062d\\u062a\\u0645\\u0644\\u064a\\u0646. \\u0642\\u062f \\u064a\\u0642\\u0648\\u0644 \\u0634\\u064a\\u0626\\u064b\\u0627 \\u0643\\u0647\\u0630\\u0627:\",\"en\":\"This is an example page. It differs from a blog post in that it will stay in one place and will appear in your site\'s navigation (in most themes). Most people start with the \'About\' page that you introduce to them\",\"ger\":\"Dies ist eine Beispielseite. Er unterscheidet sich von einem Blogbeitrag darin, dass er an einem Ort bleibt und in der Navigation Ihrer Website erscheint (in den meisten Themen). Die meisten Leute beginnen mit der \\u201e\\u00dcber\\u201c-Seite, die Sie ihnen vorstellen\",\"fr\":\"Ceci est une page d\'exemple. Il diff\\u00e8re d\'un article de blog en ce qu\'il restera au m\\u00eame endroit et appara\\u00eetra dans la navigation de votre site (dans la plupart des th\\u00e8mes). La plupart des gens commencent par la page \\\"\\u00c0 propos\\\" que vous leur pr\\u00e9sentez\",\"tr\":\"Bu bir \\u00f6rnek sayfad\\u0131r. Tek bir yerde kalmas\\u0131 ve sitenizin navigasyonunda (\\u00e7o\\u011fu temada) g\\u00f6r\\u00fcnmesi bak\\u0131m\\u0131ndan bir blog g\\u00f6nderisinden farkl\\u0131d\\u0131r. \\u00c7o\\u011fu insan, onlara tan\\u0131tt\\u0131\\u011f\\u0131n\\u0131z \'Hakk\\u0131nda\' sayfas\\u0131yla ba\\u015flar.\",\"pt\":\"Esta \\u00e9 uma p\\u00e1gina de exemplo. Ele difere de uma postagem de blog, pois ficar\\u00e1 em um lugar e aparecer\\u00e1 na navega\\u00e7\\u00e3o do seu site (na maioria dos temas). A maioria das pessoas come\\u00e7a com a p\\u00e1gina \'Sobre\' que voc\\u00ea apresenta a elas\",\"bn\":\"\\u098f\\u0987 \\u098f\\u0995\\u099f\\u09bf \\u0989\\u09a6\\u09be\\u09b9\\u09b0\\u09a3 \\u09aa\\u09c3\\u09b7\\u09cd\\u09a0\\u09be\\u0964 \\u098f\\u099f\\u09bf \\u098f\\u0995\\u099f\\u09bf \\u09ac\\u09cd\\u09b2\\u0997 \\u09aa\\u09cb\\u09b8\\u09cd\\u099f \\u09a5\\u09c7\\u0995\\u09c7 \\u0986\\u09b2\\u09be\\u09a6\\u09be \\u09af\\u09c7 \\u098f\\u099f\\u09bf \\u098f\\u0995 \\u099c\\u09be\\u09af\\u09bc\\u0997\\u09be\\u09af\\u09bc \\u09a5\\u09be\\u0995\\u09ac\\u09c7 \\u098f\\u09ac\\u0982 \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09b8\\u09be\\u0987\\u099f\\u09c7\\u09b0 \\u09a8\\u09c7\\u09ad\\u09bf\\u0997\\u09c7\\u09b6\\u09a8\\u09c7 (\\u09ac\\u09c7\\u09b6\\u09bf\\u09b0\\u09ad\\u09be\\u0997 \\u09a5\\u09bf\\u09ae\\u09c7) \\u09aa\\u09cd\\u09b0\\u09a6\\u09b0\\u09cd\\u09b6\\u09bf\\u09a4 \\u09b9\\u09ac\\u09c7\\u09f7 \\u09ac\\u09c7\\u09b6\\u09bf\\u09b0\\u09ad\\u09be\\u0997 \\u09b2\\u09cb\\u0995\\u0987 \'\\u09b8\\u09ae\\u09cd\\u09aa\\u09b0\\u09cd\\u0995\\u09c7\' \\u09aa\\u09c3\\u09b7\\u09cd\\u09a0\\u09be \\u09a6\\u09bf\\u09af\\u09bc\\u09c7 \\u09b6\\u09c1\\u09b0\\u09c1 \\u0995\\u09b0\\u09c7 \\u09af\\u09be \\u0986\\u09aa\\u09a8\\u09bf \\u09a4\\u09be\\u09a6\\u09c7\\u09b0 \\u09b8\\u09be\\u09a5\\u09c7 \\u09aa\\u09b0\\u09bf\\u099a\\u09af\\u09bc \\u0995\\u09b0\\u09bf\\u09af\\u09bc\\u09c7 \\u09a6\\u09c7\\u09a8\",\"ru\":\"\\u042d\\u0442\\u043e \\u0441\\u0442\\u0440\\u0430\\u043d\\u0438\\u0446\\u0430-\\u043e\\u0431\\u0440\\u0430\\u0437\\u0435\\u0446. \\u041e\\u043d \\u043e\\u0442\\u043b\\u0438\\u04